var config = { // 変数に設定を格納する
} module.exports = (env, argv) => { switch(argv.mode) { case 'development': config.devtool = 'source-map'; break; case 'production': break; } return config;
} それか、 こちらのページ から、以下のような複数のwebpackの設定ファイルを用意する方法もある。 個人的にはこちらの方が好み。 共通の設定を書いたファイル(webpack.common.js) 開発時の設定ファイル(webpack.dev.js) 公開時の設定ファイル(webpack.prod.js) webpack.common.js を他のファイルからimportして使っている形になる。 また、内部で webpack-merge パッケージを使っているのでインストールする必要がある。 // webpack.common.js
